import React from 'react'
import {AiOutlineAppstoreAdd} from 'react-icons/ai'
const Todo = () => {
  return (
    <div className='todo'>
        <div className="form">
            <input type="text" />
            <AiOutlineAppstoreAdd/>

        </div>
    </div>
  )
}

export default Todo
